import React from 'react';

export default function DepositOrWithdrawal() {
  return (
    <div>
      <h1>DepositOrWithdrawal</h1>
      <h2>Usuário</h2>
      <div>
        <p>Saldo em Conta:</p>
        <p>R$ 000,00</p>
      </div>
      <div>
        <button type="button">Depósito</button>
        <button type="button">Retirada</button>
        <input type="text" id="text" placeholder="Informe o Valor" />
      </div>
      <button type="button">Voltar</button>
      <button type="button">Confirmar</button>
    </div>
  );
}
